export default function Temp() {
  const [num, setNum] = React.useState(0);

  return (
    <div>
      <h1>{num}</h1>
      <button onClick={() => setNum((prevNum) => prevNum - 1)}> - MINUS </button>
      <button>+ PLUS</button>
    </div>
  );
}
